import React from "react";
import { Redirect, Route, Switch } from "react-router-dom";
import DCIndex from "../pages/DC";
import CcrInIndex from "../pages/logistics/ccr";
import CcrIndex from "../pages/logistics/ccr";
import CcrOutIndex from "../pages/logistics/ccr/ccrOut";
import CourierInIndex from "../pages/logistics/courier";
import CourierIndex from "../pages/logistics/courier";
import CourierOutIndex from "../pages/logistics/courier/courierOut";
import CourierInvoiceIndex from "../pages/logistics/courier/invoice";
import DeliveryChallanIndex from "../pages/logistics/delivery-challan";

import DeliveryChallanBrowse from "../pages/logistics/delivery-challan/browse";
import ChallanIndexMdc from "../pages/logistics/delivery-challan/mdc";
import SlWipIndex from "../pages/logistics/delivery-challan/slwip/index";
import ChallanIndex from "../pages/logistics/delivery-challan/subIndex";
import JobWorkIndex from "../pages/logistics/job-work";
import JobWorkOutIndex from "../pages/logistics/job-work/jobWorkOut";
import MrnDcIndex from "../pages/logistics/material-receipt-note";
import MrnPoIndex from "../pages/logistics/material-receipt-note/mrn-po";
import ReturnableIndex from "../pages/logistics/returnable-gate-pass";

const Logistics = () => {
  return (
    <div className="container-fluid">
      <Switch>
        <Route path="/logistics/sl-dc" exact component={ChallanIndex} />
        <Route path="/logistics/non-sl-dc" exact component={ChallanIndex} />
        <Route path="/logistics/mdc" exact component={ChallanIndexMdc} />
        <Route path="/logistics/sl-wip" exact component={SlWipIndex} />
        <Route path="/logistics/non-sl-wip" exact component={SlWipIndex} />
        <Route path="/logistics/dc-packaging" exact component={DCIndex} />
        <Route path="/logistics/in/mrn-dc" exact component={MrnDcIndex} />
        <Route path="/logistics/mrn-po" exact component={MrnPoIndex} />
        <Route path="/logistics/mrn-wip" exact component={MrnDcIndex} />
        <Route path="/logistics/rgp" exact component={ReturnableIndex} />
        <Route path="/logistics/rrgp" exact component={ReturnableIndex} />
        <Route path="/logistics/jwin" exact component={JobWorkIndex} />
        <Route path="/logistics/jwo" exact component={JobWorkOutIndex} />
        <Route path="/logistics/ccr-in" exact component={CcrInIndex} />
        <Route path="/logistics/ccr-out" exact component={CcrOutIndex} />
        <Route path="/logistics/in" exact component={CourierInIndex} />
        <Route path="/logistics/out" exact component={CourierOutIndex} />
        <Route path="/logistics/invoice" exact component={CourierInvoiceIndex} />
        <Route
          path="/logistics/delivery-challan"
          exact
          component={DeliveryChallanIndex}
        />

        <Redirect to="/logistics/in/mrn-dc" from="/logistics" />
        <Redirect to="/logistics/in" from="/logistics/in" />
      </Switch>
    </div>
  );
};

export default Logistics;
